import React from 'react';

const Navbar = () => {
    return (
        <nav class="navbar navbar-dark bg-primary mb-3">
            <div className="container">
                <a class="navbar-brand" href="/">WikiCountries</a>
            </div>
        </nav>
    )
}

export default Navbar
